using namespace std;

int main(){
    int n, k;
    while(cin >> n >> k){
        if(n == 0 && k == 0) break;
        vector<int> v(n);
        for(int &x:v) cin >> x;
        multiset<int> cj;
        for(int i = 0; i < k; i++){
            cj.insert(v[i]);
        }
        cout << *cj.begin();
        for(int i = k; i < n; i++){
            cj.insert(v[i]);
            cj.erase(cj.find(v[i-k]));
            cout << " " << *cj.begin();
        }
        cout << "\n";
    }
    return 0;
}

