int main(){
    int n, k;
    while(cin >> n >> k){
        if(n == 0 && k == 0) break;
        vector<int> v(n);
        for(int &x:v) cin >> x;
        set<pair<int, int>> cj;
        for(int i = 0; i < k; i++){
            cj.insert({v[i], i});
        }
        cout << cj.begin()->first;
        for(int i = k; i < n; i++){
            cj.insert({v[i], i});
            cj.erase({v[i-k], i-k});
            cout << " " << cj.begin()->first;
        }
        cout << "\n";
    }
    return 0;
}

