        digitalWrite(A2, LOW);   // вывод состояния светодиода
        status = 3;
      }
      break;

    case 3:
      if (flagClick == true) {
        // было нажатие кнопки
        flagClick = false;  // сброс признака фронта кнопки
        oled.home();        // курсор в 0,0
