                oled.print("  PLUS ");
        state = 2;
      }
      break;

    case 2:
      digitalWrite(9, HIGH);
      if (flagClick1 == true) {
        flagClick1 = false;
       oled.setCursor(0, 5);
       oled.print("  1Hz ");
        state = 3;
      }
      break;

    case 3:
