        flagClick1 = false;
          oled.setCursor(0, 5);
       oled.print("  25Hz ");
        state = 6;
      }
      break;

    case 6:
      digitalWrite(9, (millis() / 20) % 2);
      if (flagClick1 == true) {
        flagClick1 = false;
          oled.setCursor(0, 5);
       oled.print("  60Hz ");
        state = 7;
      }
      break;
    case 7:
      digitalWrite(9, (millis() / 8) % 2);
      if (flagClick1 == true) {
        flagClick1 = false;
          oled.setCursor(0, 5);
       oled.print("  125Hz ");
        state = 8;
      }
      break;
    case 8:
      digitalWrite(9, (millis() / 4) % 2);
      if (flagClick1 == true) {
        flagClick1 = false;
          oled.setCursor(0, 5);
       oled.print(" MINUS");  
        state = 0;
      }
      break;
  }
}


void adc() {
  int analogPin = 3;
  int val = 0;


  val = analogRead(analogPin);  // считываем напряжение с аналогового входа
                                // наблюдаем считанное значение
  if (val > 780) {
    digitalWrite(0, HIGH);
    digitalWrite(1, LOW);
  }

  else {
    digitalWrite(0, LOW);
    digitalWrite(1, HIGH);
  }
  // delay(1000);
}

