# O(n)
def czy_ros_mal(ciag):
    def ros(ciag):
        if len(ciag) < 2:
            return False
        poprzedni = ciag[0]
        for num in ciag[1:]:
            if poprzedni >= num:
                return False
            poprzedni = num
        return True
    def mal(ciag):
        if len(ciag) < 2:
            return False
        poprzedni = ciag[0]
        for num in ciag[1:]:
            if poprzedni <= num:
                return False
            poprzedni = num
        return True

    if len(ciag) < 4:
        return False
    # pivot to pierwszy element
    for pivot in range(0, len(ciag)):
        if not ros(ciag[:pivot]):
            continue
        if not mal(ciag[pivot:]):
            continue
        return True
    return False

