// Pins for the fingerprint sensor, connect to the hardware serial pins of your Arduino
#define FINGERPRINT_RX 4
#define FINGERPRINT_TX 5

// Create software serial object
SoftwareSerial mySerial(FINGERPRINT_RX, FINGERPRINT_TX);

// Create fingerprint sensor object
Adafruit_Fingerprint finger = Adafruit_Fingerprint(&mySerial);

// Pin for the servo motor
#define SERVO_PIN 6

// Create servo object
Servo myServo;

void setup() {
  // Start serial communication
  Serial.begin(9600);
  while (!Serial);  // for Leonardo/Micro/Zero

  // Initialize the fingerprint sensor
  if (finger.begin(57600) == -1) {
    Serial.println("Fingerprint sensor not detected");
    while (1);
  }
  Serial.println("Fingerprint sensor detected");

  // Initialize the servo motor
  myServo.attach(SERVO_PIN);
}

void loop() {
  // Try to get a fingerprint match
  if (getFingerprintID() == 0) {
    // If match, rotate the servo motor
    myServo.write(180);
    delay(1000);  // wait for a second
  }
}

uint8_t getFingerprintID() {
  uint8_t result = finger.getImage();

  if (result != FINGERPRINT_OK) return -1;

  result = finger.image2Tz();

  if (result != FINGERPRINT_OK) return -1;

  result = finger.fingerFastSearch();

  if (result != FINGERPRINT_OK) return -1;

  // If we found a match, return 0
  return 0;
}

