using namespace std;

int main(){
    int n, k;
    while(cin >> n >> k){
        if(n == 0 && k == 0) break;
        vector<int> v(n);
        for(int &x:v) cin >> x;
        // priority_queue<int> pq;
        priority_queue<pair<int, int>, vector<pair<int, int>>, greater<pair<int, int>>> pq;
        for(int i = 0; i < k; i++){
            pq.push({v[i], i});
        }
        cout << pq.top().first;
        for(int i = k; i < n; i++){
            pq.push({v[i], i});
            while(pq.size() != 0 && pq.top().second < i-k+1){
                pq.pop();
            }
            cout << " " << pq.top().first;
        }
        cout << "\n";
    }
    return 0;
}

