    class FanoShennon
    {

        public FanoShennon(double[] p, char[] letters)
        {
            prob = p;
            let = letters;
            Res = new string[prob.Length];
        }
        double[] prob;
        internal char[] let;
        internal string[] Res;

        double schet1 = 0;
        double schet2 = 0;

        public void Sort()
        {
            for (int i = 0; i < prob.Length; i++)
            {
                for (int j = 0; j < prob.Length - i - 1; j++)
                {
                    if (prob[j] < prob[j + 1])
                    {
                        char temp2;
                        double temp1 = 0;

                        temp1 = prob[j];
                        temp2 = let[j];
                        prob[j] = prob[j + 1];
                        let[j] = let[j + 1];
                        prob[j + 1] = temp1;
                        let[j + 1] = temp2;

                    }
                }
            }

        }
        int m;

        public int Delenie_Posledovatelnosty(int L, int R)
        {

            schet1 = 0;
            for (int i = L; i <= R - 1; i++)
            {
                schet1 = schet1 + prob[i];
            }

            schet2 = prob[R];
            m = R;
            while (schet1 >= schet2)
            {
                m = m - 1;
                schet1 = schet1 - prob[m];
                schet2 = schet2 + prob[m];
            }
            return m;

        }

        public void Fano(int L, int R)
        {
            int n;

            if (L < R)
            {

                n = Delenie_Posledovatelnosty(L, R);
                //Console.WriteLine(n);

                for (int i = L; i <= R; i++)
                {
                    if (i <= n) Res[i] += Convert.ToByte(0);
                    else Res[i] += Convert.ToByte(1);
                }

                Fano(L, n);
                Fano(n + 1, R);

            }
        }

    }
}

package advanced;

import java.util.*;

public class Main {

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        String[] children = scanner.nextLine().split(" ");
        int toss = Integer.parseInt(scanner.nextLine());

        PriorityQueue<String> queue = new PriorityQueue<>();

        for (String child : children) {
            queue.offer(child);
        }

        int cycle = 1;

        while (queue.size() > 1) {
            for (int i = 1; i < toss; i++) {
                queue.offer(Objects.requireNonNull(queue.poll()));
            }
            if (isPrime(cycle)) {
                System.out.println("Prime " + queue.peek());
            } else {
                System.out.println("Removed " + queue.poll());
            }
            cycle++;
        }

        System.out.println("Last is " + queue.poll());

    }

    private static boolean isPrime(int cycle) {
        boolean isPrime = true;
        for (int i = 2; i <= cycle - 1; i++) {
            if (cycle % i == 0) {
                isPrime = false;
                break;
            }
        }
        if (cycle == 1) {
            return false;
        }
        return isPrime;
    }

}

import java.util.Scanner;

public class Ex02FromLeftToTheRight {

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int n = Integer.parseInt(scanner.nextLine());

        for (int i = 0; i < n; i++) {
            String input = scanner.nextLine();

            String leftNumber = "";
            String rightNumber = "";

            for (int j = 0; j < input.length(); j++) {
                char currentSymbol = input.charAt(j);

                if (currentSymbol == 32) {

                    for (int k = j + 1; k < input.length(); k++) {
                        rightNumber += input.charAt(k);
                    }
                    break;
                }
                leftNumber += input.charAt(j);
            }

            long leftDigits = Long.parseLong(leftNumber);
            long rightDigits = Long.parseLong(rightNumber);

            long maxNumber = Math.abs(Math.max(leftDigits, rightDigits));
            int digitsSum = 0;

            while (maxNumber > 0) {
                long currentDigit = maxNumber % 10;
                digitsSum += currentDigit;
                maxNumber /= 10;
            }

            System.out.println(digitsSum);
        }

    }
}

namespace Miner
{
    using System;
    public class Program
    {
        static void Main(string[] args)
        {
            //INPUT
            int size = int.Parse(Console.ReadLine());
            string[] moves = Console.ReadLine().Split(" ", StringSplitOptions.RemoveEmptyEntries);

            //ACTION
            string[,] field = new string[size, size];

            //Creating The Field And Searching The Start And The Coals
            int currentRow = 0;
            int currentCol = 0;
            int coals = 0;

            for (int row = 0; row < size; row++)
            {
                string[] currentRowArray = Console.ReadLine().Split();

                for (int col = 0; col < size; col++)
                {
                    field[row, col] = currentRowArray[col];

                    if (currentRowArray[col] == "s")
                    {
                        currentRow = row;
                        currentCol = col;
                    }
                    else if (currentRowArray[col] == "c")
                    {
                        coals++;
                    }
                }
            }            

            //Miner Moving
            for (int i = 0; i < moves.Length; i++)
            {
                int stepRow = 0;
                int stepCol = 0;

                //Up
                if (moves[i] == "up")
                {
                    stepRow--;                    
                }

                //Down
                else if (moves[i] == "down")
                {
                    stepRow++;
                }

                //Left
                else if (moves[i] == "left")
                {
                    stepCol--;
                }

                //Right
                else if (moves[i] == "right")
                {
                    stepCol++;
                }

                if (isValid(currentRow + stepRow, currentCol + stepCol, size))
                {
                    currentRow += stepRow;
                    currentCol += stepCol;

                    //If Coal Is Found
                    if (field[currentRow, currentCol] == "c")
                    {
                        coals--;
                        field[currentRow, currentCol] = "*";

                        if (coals == 0)
                        {
                            Console.WriteLine($"You collected all coals! ({currentRow}, {currentCol})");
                            return;
                        }
                    }
                    //If Current Index Is Game Stop (e)
                    else if (field[currentRow, currentCol] == "e")
                    {
                        Console.WriteLine($"Game over! ({currentRow}, {currentCol})");
                        return;
                    }
                }                
            }

            //OUTPUT
            Console.WriteLine($"{coals} coals left. ({currentRow}, {currentCol})");

            //Valid Index Checker
            static bool isValid(int row, int col, int size)
            {
                return (row >= 0 && row < size && col >= 0 && col < size);
            }
        }
    }
}

